import React from 'react';
import { Link } from 'react-router-dom';
import './myaccount.css';
import Navbar from '../../components/navbar';
const MyAccount = () => {
  return (
    <div>
        <Navbar/>
    <div>
      <header>
        <h1>Welcome to My Account</h1>
      </header>
      <nav>
        <ul>
          <li>
            <Link to="/myaccount/personaldata">Personal Data</Link>
          </li>
          <li>
            <Link to="/myaccount/myorders">My Orders</Link>
          </li>
        </ul>
      </nav>
      <section>
        <h2>Personal Data</h2>
        {/* Your personal data content goes here */}
      </section>
      <section>
        <h2>My Orders</h2>
        {/* Your my orders content goes here */}
      </section>
    </div>
    </div>
  );
};

export default MyAccount;
